import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { KeycloakProvider } from '@react-keycloak/web';
import Keycloak from 'keycloak-js';

// Инициализация Keycloak
const keycloak = new Keycloak({
  url: 'http://localhost:3000/auth',
  realm: 'master', // Это имя вашего realm
  clientId: 'react-client' // Имя клиента, который вы создали в Keycloak
});

// Обертка приложения в KeycloakProvider
ReactDOM.render(
  <KeycloakProvider
    keycloak={keycloak}
    initOptions={{ onLoad: 'login-required' }} // При старте приложение будет требовать логин
  >
    <App />
  </KeycloakProvider>,
  document.getElementById('root')
);
